content:
@Jim_Jordan Jim Jordan
Watch nude boys
Brings you joy

@robertsofia Nowhere in there does it say to sell joy. How much of our culture’s belief in status is tied to envy and power, for instance, versus joy?

I was simply offering a perspective that I thought might help people make more informed choices.

Never advocated either/or.

@althea89157 It's A nice diversion from The madness of the world
And I bet it warmed your heart 2 see how such A little thing could bring joy
To your little munchkin

@KSPrior All ≈ 25%!

I put “personal validation“ b/c I feel God has given me a joy and gift in writing, and I yearn to be generous of this! Inferiority cripples me most in this — so the urgency stems from working this out in order to do good work.

Do I owe you for this therapy session?
